class Solution:
    def majorityElement(self, nums):
        l={}
        max=0
        item=1
        for i in nums:
            if(i in l):
                l[i]+=1
            else:
                l[i]=1
            if(max<l[i]):
                max=l[i]
                item=i
        return item

